const PAGE_SIZE = 15;

type SeasonCreadit = {
  season_idx: number;
  season_name: string;
  total: string;
};

interface IRowData {
  wallet: string;
  seasons_credit: SeasonCreadit[];
  season_total_credit: string;
  activity_credit: string;
  metaforo_credit: string;
  seed_count: number;
  effective_credit: string;
  metaforo_vote_count: string;
}

const ColGroup = ({ seasons,hasSentFlag,show }: { seasons: number[],hasSentFlag:boolean,show:boolean }) => {
  return (
    <colgroup>
      {/* sns */}
      <col style={{ width: '150px' }} />
      {/* seasons */}
      {seasons.map((s) => (
        <col style={{ width: '100px' }} key={s} />
      ))}
      {/* vote */}
      <col style={{ width: '100px' }} />
      {/* season reward */}
      {
        ((!hasSentFlag && show) || hasSentFlag) && <col style={{ width: "120px" }} />
      }

      {/* total */}
      <col style={{ width: '120px' }} />
      {/* active */}
      <col style={{ width: '120px' }} />
      {/* effective */}
      <col style={{ width: '120px' }} />
      {/* seed */}
      <col style={{ width: '150px' }} />
    </colgroup>
  );
};

